Doing a makeup tutorial outside is not as easy as it looks 🌚 The bugs, the sun in my eyes, a horrible mirror... Literally hell lmao
These makeup products are what I’ve been consistently using for my dry skin since it’s been blazin outside.... I love when it’s blazing outside lol
@nyxcosmetics Bare With Me Primer
(This has SPF 30 in it) 
@anastasiabeverlyhills Luminous Foundation
@juviasplace concealer & contour stick 
@milkmakeup setting powder (OMG FAV)
@bhcosmetics stellar lash mascara
@fentybeauty cream blush (These are dope af)
@buxomcosmetics plumping lipgloss “pink champagne” 
@fentybeauty What It Dew Refreshing Spray
@thestayblowingmindscollection lashes - Outrageous 
Press on Nails: @smileysglamstudio 
What’s your a new summer makeup products you just bought? 🤎✨
